import React from 'react'
import WishComponent from './WishComponent'
class WishesComponent extends Component({ editInputWish, setUpdateWish, wishes, startwish, editWish, deleteWish, finishWish }) {
    
    
    
    render() {
        return (
            <div >
                {
                    wishes.map((wish) => {
                        return <WishComponent deleteWish={deleteWish} editWish={editWish} startwish={startwish} money={wish.money} id={wish.id} finishWish={wish.finishWish} functionFinishWish={finishWish} wishText={wish.wishText} edit={wish.edit} editInputWish={editInputWish} setUpdateWish={setUpdateWish} />
                    })
                }
            </div>
        )
    }

}

export default WishesComponent
